import React from 'react'
import { Link } from 'react-router-dom'

class Header extends React.Component {

    state = {
        seachTerm: ""
    }

    render(){

        return (
            <header>

                    <div className="logo">LeanOn.me </div>

                <form className="search" onSubmit={this.handleSubmit}>
                    <input type="text" placeholder="ðŸš§Search function in progressðŸš§" value={this.state.searchTerm} onChange={this.handleChange} />
                    <input type="submit" value="Search" />
                </form>
                 <div className="actions">
                {this.props.currentUser ? (
            <>
                <Link to='/profile'>
                    <button>Profile</button>
                </Link>
                <button onClick={this.handleLogout}>Logout {this.props.currentUser.username}</button>
            </>
          ) : (
              <>
                <Link to="/login">
                  <button>Login</button>
                </Link>
                <Link to="/signup">
                  <button>Sign Up</button>
                </Link>
              </>
            )}
        </div>
      </header>
        )
    }
}

export default Header;
